‚Ä¢ US Digital Response was suggested to help with and then take over ‚Äòabsentee ballot curing,‚Äô and to ‚Äòhelp streamline the hiring, onboarding, and management‚Äô of Green Bay‚Äôs poll workers.

‚Ä¢ The Brennan Center which focuses on ‚Äòelection integrity‚Äô including ‚Äòpost-election audits and cybersecurity.‚Äô‚Äù

