‚Äú‚Ä¢ Vote at Home‚Ä¶ offered to ‚Äòlend a hand‚Äô to Central Count stations;

‚Ä¢ Offered to connect a municipality to ‚Äòpartners like Power the Polls‚Äô to recruit poll workers; to partner with CTCL to send out e-mails to recruit poll workers;

